import { Button, TextField } from "@material-ui/core";
import React from "react";
import Style from "./Home.module.css";
const Home = () => {
  return (
    <div className={Style["home-page"]}>
      <div className={Style["home-page__details"]}>
        <div className={Style["home-page__settings"]}>
          <h2>Quiz Settings</h2>
        </div>
        <TextField id="outlined-basic" label="Enter Name" variant="outlined" style={{margin: "10px"}}/>
        <TextField select label="Select Category" variant="outlined" />
        <TextField select label="Select Level" variant="outlined" />
        <Button variant="contained">Contained</Button>
      </div>
      <div className={Style["home-page__img"]}>
        <img src="quiz.jpg" />
      </div>
    </div>
  );
};

export default Home;
